import { createGlobalStyle } from 'styled-components';

const privacy_style = createGlobalStyle`
 .color{
     color:#34554 !importent;
 }
 .privacy-icon-logo{
     width:auto;
     height:150px;
     color:#ee514f;
 }
 .check-color{
     color:#fba62f;
 }
 .privacy-heading{
    height: 500px;
    padding-top: 125px;
 }
 @media only screen (max-width=720px)
{
    .privacy-icon-logo{
        position absoulte;
        right: 30%;
